import React, { useState } from 'react';
import ReactDOM from 'react-dom';
import { Button, CssBaseline, Container, Typography } from '@mui/material';
import RegistrationForm from './components/Form';
import ExamForm from './components/ExamForm';
import PatientDetails from './PatientReports';
import './styles.css';

const App = () => {
  const [showPatientForm, setShowPatientForm] = useState(true);
  const [showExamForm, setShowExamForm] = useState(false);

  const handleExamLinkClick = () => {
    setShowPatientForm(false);
    setShowExamForm(true);
  };

  const handlePatientLinkClick = () => {
    setShowExamForm(false);
    setShowPatientForm(true);
  };

  return (
    <Router>
      <Switch>
        <Route path="/registro">
          {/* Render RegistrationForm when the path is /registro */}
          <Container component="main" maxWidth="sm" style={{ textAlign: 'center', display: 'flex', flexDirection: 'column', padding: '3rem', gap: '1rem' }}>
            <CssBaseline />
            <Typography variant="h4" color="primary" gutterBottom>
              Registro de Pacientes
            </Typography>
            <RegistrationForm />
          </Container>
        </Route>

        <Route path="/exames">
          {/* Render ExamForm when the path is /exames */}
          <Container component="main" maxWidth="sm" style={{ textAlign: 'center', display: 'flex', flexDirection: 'column', padding: '3rem', gap: '1rem' }}>
            <CssBaseline />
            <Typography variant="h4" color="primary" gutterBottom>
              Registro de Exames
            </Typography>
            <ExamForm />
          </Container>
        </Route>

        <Route path="/pacientes/:numero_atendimento">
          {/* Render PatientDetails when the path includes /pacientes/ followed by a dynamic parameter */}
          <PatientDetails />
        </Route>

        <Route path="/">
          {/* Render default component (in this case, RegistrationForm) when no specific path is matched */}
          <Container component="main" maxWidth="sm" style={{ textAlign: 'center', display: 'flex', flexDirection: 'column', padding: '3rem', gap: '1rem' }}>
            <CssBaseline />
            <Typography variant="h4" color="primary" gutterBottom>
              Registro de Pacientes
            </Typography>
            <RegistrationForm />
          </Container>
        </Route>
      </Switch>
    </Router>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
